  uploadFilePending: false,
  uploadFileError: null,
  isUploading: false,
  parsedData: null,
  conanData: null,
  layoutHeader: "Spine",
  fileDownloadKey: null,
  downloadFilePending: false,
  downloadFileError: null,
};

export default initialState;
